import React from 'react';

const FlagJp = props => (
  <svg viewBox="0 0 900 600" {...props}>
    <path fill="#fff" d="M0 0h900v600H0z" />
    <circle fill="#bc002d" cx={450} cy={300} r={180} />
  </svg>
);

export default FlagJp;
